import React from 'react';
import Avatar from './Avatar';

export default function ChangeUser(props) {
  function onClickBatman() {
    return props.onClick('batman');
  }

  function onClickSuperman() {
    return props.onClick('superman');
  }

  function onClicWonderWoman() {
    return props.onClick('wonderWoman');
  }

  return (
    <div>
      <h6>Visualizar Timeline com:</h6>
      <div>
        <div onClick={onClickBatman}>
          <Avatar />
        </div>
        <Avatar onClick={onClickSuperman} />
        <Avatar onClick={onClicWonderWoman} />
      </div>
    </div>
  );
}
